import React, { Component, Fragment } from 'react'
import Grid from '@material-ui/core/Grid';

const styles = {
    container: {
        border: "2px solid",
        height: "500px",
        margin: "75px 10px"
    }
}

export class Modules extends Component {

    render() {
        return (
            <Grid style={styles.container} item sm={8} xs={12}>
                <p style={{fontSize:"100px"}}>Moduless</p>
            </Grid>
        )

    }
}



export default (Modules);
